// var React=require('react'); // first we writelike this
import React from 'react';//babel converts this line to first
// var ReactDom=require('react-dom');
import ReactDom from 'react-dom';
const fname="pritam kumar";
const lname="sarangi";
const img1="https://picsum.photos/seed/picsum/536/354";
const img2="https://picsum.photos/seed/picsum/520/340";
const img3="https://picsum.photos/seed/picsum/506/330";

ReactDom.render(<>
    <h1>{`My first name is ${fname} and my last name is ${lname}`} </h1>
    </>,
    document.getElementById("root"));


ReactDom.render(<><h1>My Netflix Picks</h1>
<p>List of my top 5 series</p>
<ol contentEditable="true">
    <li >Wednesday</li>
    <li>Sacred Games</li>
    <li>squid games</li>
    <li>Paatal Lok</li>
    <li>family Man</li>
</ol>
<img src={img1} />
<img src={img2} />
<img src={img3} />
</>,
document.getElementById("root2"));

const currdate=new Date().toLocaleDateString();
const currtime=new Date().toLocaleTimeString();

ReactDom.render(<>
    <h1>{`Todays's date is ${currdate} and today's time is ${currtime}`} </h1>
    </>,
    document.getElementById("root3"));
